            "textDisplay": "¿Ciencia ficcion? AGENDA ENMASCARADA.                                                                                                                                                               Mascaras por todos lados, la gente como zombis, no puedo ver lo que dicen, no puedo leerlos.  La sociedad se ha extraviado en un coma, en un sueño profundo. ¿Qué sera de nosotros?. Todo lo que veo es gente servil,  &quot;permanece en la fila&quot;, &quot;camina en ese sentido&quot;, &quot;utiliza la mascara&quot;, &quot;no hables&quot;, &quot;no salgas de tu casa&quot; o &quot;no visites a tu familia&quot;, &quot;mantente alerta&quot;, &quot;lavate las manos y guarda tu distancia&quot;. &quot;Tu debes cumplir con estas reglas y no te pases de la raya&quot;. Ese fue el inicio, nunca pense que podria llegar tan lejos. Habia visto las peliculas de ciencia ficcion, lo habia leido en los libros de Arthur C. Clarke y de Philip K. Dick. Pero ¿esta esto ocurriendo de verdad?, ¿es esto real?. O ¿es esto una simulacion?. Pensamos que hacemos nuestras elecciones, pensamos que tomamos nuestras decisiones,  pero no. Se estan tomando decisiones por nosotros. Se siente como si estuvieran experimentando con nosotros. Usados como sujetos de prueba, para ver lo que puede ser de nosotros. ¿Esta nuestro nivel de conciencia siendo paralizado o aun... reemplazado?. ¿Esta siendo detenido nuestro avance hacia la vision mas grande de nosotros mismos?. La gente que se rebelo, que se resistio o trato de hablar fue silenciada por las masas. Fue tachada como la plaga, la escoria, la mugre de la sociedad. Aquellos que no obedecian, fueron llevados a campamentos externos en donde eran rehabilitados. Entonces ya acataban las ordenes, y ya nadie podia pensar por si mismo. La gente obedecia,... las calles se volvieron silenciosas. Londres estaba acabado, y la unica vida que quedaba era la de los momolitos que se construian en la ciudad. La gente caminaba por las calles en busca de felicidad, pero todo estaba roto, destruido, aniquilado. Cuando las mascaras fueron introducidas, nadie se doy cuenta a lo que nos estaba llevando, fuimos engañados y silenciados. ¿De aqui para donde vamos? Seremos llevados por la cinta transportadora sofocandonos lentamente...¿sin ninguna reflexion, cuestionamiento o resistencia?. Todo lo que ahora vemos son nuestras cuatro paredes y la dictadura del gobierno expresandose a traves de la pantalla. Diciendonos todos los dias, como vivir nuestras vidas. La humanidad esta acabada, terminada. La implementacion de tecnologia dentro de nuestro cuerpo es lo que sigue en la agenda. La evolucion natural ha llegado a su fin, no hay opcion. Y es el unico camino a seguir. Dijeron que todo volveria a la normalidad despues de la vacuna, pero poco cambio. Solo empeoraba...nuestra sociedad ha sido destruida. Y nunca se recuperara de esta opresion. Tal vez otros saben, pero tovia no han hablado. Tal vez hay alianzas que se han formado. Tal vez los extraterrestres nos van a salvar. Tal vez el mundo sea salvado por extraterrestres. ¿Soy yo extraterrestre?. ¿Que estoy haciendo aqui?, ¿quien soy yo?. ¿Que es este lugar?...ya no lo reconozco. Nunca hubo la intencion de que el mundo volviera a la normalidad. Y la palabra normal nunca existio de todas maneras. La sociedad siempre se ha escondido detras de la mascara. Pero ahora tenemos la excusa para ponernos una. ¿Cual es el futuro?...Writer, Zachary Denman",
